INSERT INTO `notices` VALUES (1,'Submit your Scholastic data until 4/09/2017  10:00 AM','No further submissions will be entertained after 04/09/2017 10:00 AM',1,'2028-03-17 14:43:26','admin@xmail.com'),(2,'How to Enter Data?','If you have registered previously,then use that email id and password to login else Register.\r\nIf you forgot password then select forgot password.\r\nAfter logging in select Scholastic Data from LHS and enter your details.\r\nUse Manage submission from LHS to check your current submission.\r\n',1,'2015-08-17 13:06:05','rahuldeepattri1996@gmail.com'),(3,'Hints','There are hints for every input to be entered. Select the input and a  \r\ntooltip will appear of RHS of input box to help you enter data.',1,'2015-08-17 13:07:59','admin@xmail.com');
